import React,{Component} from 'react';
import axios from 'axios';

class Axioss extends Component{
    componentDidMount() {
        axios.get('https://restcountries.com/v3.1/all')
        .then()
        .catch()
    }
    render(){
        return <div>
                    <h1>Home page</h1>
                    <h2>Hello axios</h2>
               </div>
    }
}
export default Axioss;
